import React, { useState } from "react";
import Column from "./Column";
import "../Kanban.css";

export default function KanbanTable() {
  const [todo, setTodo] = useState(["Mee töihin", "tee sitä"]);
  const [inProgress, setInProgress] = useState(["tee tätä"]);
  const [done, setDone] = useState([]);

  return (
    <div className="container">
      <h1 className="header">Kanban Table</h1>
      <div className="kanban">
        <Column header="ToDo" data={todo} />
        <Column header="In Progress" data={inProgress} />
        <Column header="Done" data={done} />
      </div>
    </div>
  );
}
